{
	var lineBreak = createLineBreak();
	munitDiv.appendChild(lineBreak);

	
	var coverage = createDiv(MUNIT_SUMMARY, "munit-summary");

	coverage.innerHTML = value;
	munitDiv.appendChild(coverage);
}


